import React, { useState } from "react";

type MatrixTaskProps = {
  matrix: number[][];
  title?: string;
};

const MatrixTask: React.FC<MatrixTaskProps> = ({ matrix, title }) => {
  const [lambdaMax, setLambdaMax] = useState<number>(0);
  const [IS, setIS] = useState<number>(0);
  const [OS, setOS] = useState<number>(0);

  // Стейт для матрицы с вычислениями, начальные значения пустые
  const [matrix4, setMatrix4] = useState(
    matrix.map(() => Array(matrix[0].length).fill('')) // Пустые значения в ячейках
  );

  // Обработчик изменения значений в матрице с вычислениями
  const handleMatrixChange = (
    rowIndex: number,
    colIndex: number,
    value: string
  ) => {
    const newMatrix = [...matrix4];
    newMatrix[rowIndex][colIndex] = value; // Обновляем только значение ячейки
    setMatrix4(newMatrix);
  };

  // Функция для округления значений перед отправкой
  const handleSubmit = () => {
    // Округляем все значения в матрице
    const roundedMatrix = matrix4.map((row) =>
      row.map((cell) =>
        cell === '' ? '' : parseFloat(cell).toFixed(2) // Округляем только если значение введено
      )
    );

    // Округляем другие значения
    const roundedLambdaMax = parseFloat(lambdaMax.toString()).toFixed(2);
    const roundedIS = parseFloat(IS.toString()).toFixed(2);
    const roundedOS = parseFloat(OS.toString()).toFixed(2);

    // Отправка данных на сервер или логика дальше
    console.log('Отправка данных:');
    console.log('Матрица:', roundedMatrix);
    console.log('λmax:', roundedLambdaMax);
    console.log('ИС:', roundedIS);
    console.log('ОС:', roundedOS);
  };

  return (
    <div style={styles.container}>
      {title && <h3 style={styles.title}>{title}</h3>}

      {/* Первая матрица: только для отображения */}
      <div style={styles.matrixContainer}>
        <h4>Исходная матрица</h4>
        <table style={styles.table}>
          <tbody>
            {matrix.map((row, rowIndex) => (
              <tr key={rowIndex}>
                {row.map((cell, cellIndex) => (
                  <td key={cellIndex} style={styles.cell}>
                    {cell}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Вторая матрица: с вычислениями и редактированием */}
      <div style={styles.matrixContainer}>
        <h4>Матрица с вычислениями</h4>
        <table style={styles.table}>
          <tbody>
            {matrix4.map((row, rowIndex) => (
              <tr key={rowIndex}>
                {row.map((cell, cellIndex) => (
                  <td key={cellIndex} style={styles.cell}>
                    <input
                      type="number"
                      step="0.01"
                      value={cell}
                      onChange={(e) =>
                        handleMatrixChange(rowIndex, cellIndex, e.target.value)
                      }
                      style={styles.inputCell}
                    />
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Поля для ввода */}
      <div style={styles.inputContainer}>
        <label style={styles.inputLabel}>λmax:</label>
        <input
          type="number"
          value={lambdaMax}
          onChange={(e) => setLambdaMax(parseFloat(e.target.value))}
          style={styles.input}
        />
        <label style={styles.inputLabel}>ИС:</label>
        <input
          type="number"
          value={IS}
          onChange={(e) => setIS(parseFloat(e.target.value))}
          style={styles.input}
        />
        <label style={styles.inputLabel}>ОС:</label>
        <input
          type="number"
          value={OS}
          onChange={(e) => setOS(parseFloat(e.target.value))}
          style={styles.input}
        />
      </div>

      {/* Кнопка отправки */}
      <button onClick={handleSubmit} style={styles.button}>Отправить</button>
    </div>
  );
};

const styles: { [key: string]: React.CSSProperties } = {
  container: {
    background: "#f9f9f9",
    borderRadius: "8px",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
    padding: "20px",
    textAlign: "center",
    margin: "20px 0",
  },
  title: {
    marginBottom: "20px",
    fontSize: "20px",
    fontWeight: "bold",
  },
  matrixContainer: {
    marginBottom: "30px",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginBottom: "10px",
  },
  cell: {
    border: "1px solid #ccc",
    padding: "10px",
    textAlign: "center",
    minWidth: "50px",
    maxWidth: "50px",
    height: "50px",
  },
  inputCell: {
    width: "50px",
    textAlign: "center",
    padding: "5px",
    border: "1px solid #ccc",
  },
  inputContainer: {
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    marginBottom: "20px",
  },
  inputLabel: {
    fontSize: "14px",
    fontWeight: "bold",
  },
  input: {
    padding: "8px",
    border: "1px solid #ccc",
    borderRadius: "4px",
    width: "100px",
    textAlign: "center",
  },
  button: {
    padding: "10px 20px",
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    borderRadius: "4px",
    fontSize: "16px",
    cursor: "pointer",
  },
};

export default MatrixTask;
